      "description": "<p>POR EL MOMENTO QUEDAN Bv9800 PRO y BV 9900 PRO</p><br><p>DISTRIBUIDORES UNICOS y OFICIALES de BLACKVIEW Argentina</p><br><p>L A T I T U D E S • S U R // Celular Industrial Militar Blackview Bv9700 Pro 4g 128gb 6gb</p><p>¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨¨</p><p>- PRODUCTO NUEVO - CAJA CERRADA -</p><br><p>ENVÍOS AL INTERIOR POR:</p><p>- Mercadoenvíos - GRATUITO -</p><p>- Oca, Micro, Expresos, Jetpack.</p><br><br><p>ENVÍOS DENTRO DE C.A.B.A Y G.B.A:</p><p>- Motomensajería (Consultar costo)</p><p>- Mercadoenvíos - GRATUITO –</p><br><br><p>FORMAS DE PAGO:</p><p>- MercadoPago, Tarjeta de Crédito o Débito</p><p>- Pago Fácil, Rapipago</p><br><p>NUESTRO HORARIO DE ATENCIÓN ES DE 11 A 18 DE LUNES A VIERNES.</p><br><p>UBICACIÓN:</p><p>- Nos encontramos en el barrio de PALERMO HOLLYWOOD.</p><p>Transporte: Línea D ESTACIÓN MINISTRO CARRANZA/ Colectivos: 39, 41, 67, 68, 108, 110, 140, 151, 168</p><br><p>•••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••</p><br><p>MIRÁ TODOS NUESTROS ARTÍCULOS !!</p><p>http://listado.mercadolibre.com.ar/_CustId_210018018</p><p>LATITUDES SUR • Somos Mercadolíderes Platinum</p><br><p>•••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••••</p><br><p>DESCRIPCIÓN DEL PRODUCTO:</p><br><p>No cabe duda después de ver tamaño maltrato, que el BV9700 Pro de Blackview es probablemente el smartphone más resistente del fabricante, además uno de lo más resistentes del mercado (o el más).</p><br><p>No en vano, las pruebas no sólo incluyen inmersión en agua, sino también resistencia al fuego directo, caídas de diversa consideración y desde diferentes alturas, así como un test de robustez mayúsculo soportando el paso de un coche por encima sin protección alguna y sin que el terminal sufra daños.</p><br><p>Buena prueba de sus capacidades para convertirse en nuestro mejor aliado en entornos extremos, es que soporta temperaturas frías y también muy elevadas sin despeinarse, algo donde los demás terminales sufren dejándonos incomunicados en cualquier momento. No hay prácticamente otro smartphone en todo mercado global que soporte un rango de temperaturas tan amplio y siga funcionando.</p><br><p>Sólo hay que remitirse a los hechos, porque el BV9700 Pro aguanta un buen rociado con gasolina y fuego directo, inmersión en agua hirviendo a 100 grados, caídas desde lo alto de un edificio, golpes en cemento, etcétera… Ni que decir tiene que el terminal cuenta con certificaciones IP69K, la más alta contra líquidos, y MIL-STD-810G con protección de grado militar.</p><br><p>Y si esto os gusta pero queréis saber más, a buen seguro que os alegrará leer que Blackview no haya querido que su smartphone más duro se quedase cojo en potencia o tuviese problemas con la experiencia de usuario, así que el hardware, como veréis ahora, también acompaña a un todoterreno como este.</p><br><br><p>Prepárate para el impacto</p><p>Probado en todas las condiciones y de -30 a + 60 ° C, evita las gotas de barro y los viajes rocosos. BV9700 Pro puede soportar golpes, presión y fuerza implacables. En el lugar de trabajo, en el campo o en busca de aventuras, este dispositivo Military Standard 810G es una solución móvil extremadamente resistente y confiable. Confíe en que su teléfono hará frente a fuertes aguaceros o un camino embarrado y continuará trabajando para usted, asegurándose de que esté conectado en todo momento.</p><br><p>Detección de calidad del aire VOC</p><p>Los contaminantes del aire interior, o más específicamente los compuestos orgánicos volátiles (COV), incluyen una amplia gama de productos químicos y sustancias. El sensor de detección de COV, que es capaz de detectar compuestos orgánicos volátiles, incluidos los compuestos químicos de origen humano y natural que son dañinos a tu salud. Evite respirar demasiados gases nocivos de habitaciones recientemente renovadas o al aire libre contaminado con aire.</p><br><p>Cámara de visión nocturna externa</p><p>La cámara externa del BV9700 Pro está equipada con un sensor CMOS sensible a la luz ultraligero STARVIS IMX291 de Sony, diseño especial para escenas nocturnas y con poca luz. El tamaño de píxel individual es de hasta 2.9um, 2.6 veces el sensor de la cámara principal del teléfono. La luz juega un papel muy importante en la fotografía. Con el aumento del tamaño de los píxeles, entra más luz en píxeles individuales. Y junto con la lente de estructura 6P de gran apertura y ultra ángulo, su teléfono se convierte instantáneamente en una unidad de visión nocturna, capturando fácilmente los maravillosos momentos en la oscuridad.</p><br><p>El procesador más inteligente jamás</p><p>AI Master P70, Debut de teléfono resistente. Helio P70 utiliza el proceso de producción FinFET de 12nm combinado con CorePilot 4.0 que proporciona un rendimiento y eficiencia energética líderes en su clase. Para que el sistema no se bloquee cuando estás inmerso en una película o un juego, y la multitarea se vuelve más rápida y fácil.</p><br><p>Android 9 Pie, Desarrollado por AI</p><p>Android 9 aprovecha el poder de la inteligencia artificial para brindarte más desde tu teléfono. Ahora su teléfono está aprendiendo sus preferencias a medida que avanza. Su experiencia mejora y mejora con el tiempo, y hace que las cosas funcionen mejor y durante más tiempo.</p><br><p>CARACTERÍSTICAS:</p><br><p>Resolución: FHD+ (2.280 x 1.080 px), formato 18:9</p><br><p>Procesador: MediaTek Helio P70 Octa-core con IA</p><br><p>RAM:6 GB</p><br><p>Almacenamiento: 128 GB ampliables con microSD</p><br><p>Batería: 4.380 mAh (no extraíble). Fast Battery Charging</p><br><p>Conectividad LTE: doble SIM, WiFi de doble banda, Bluetooth 4.2 LE, aGPS, Conector USB-C</p><br><p>Sistema operativo: Android 9.0 Pie</p><br><p>Cámara trasera: Dual de 16 MP (f/1.75) + 8 MP (f/2.0), autoenfoque PDAF, HDR, flash LED</p><br><p>Cámara frontal: 16 MP (f/2.0)</p><br>",
